import React from 'react';
import { Container, Typography, Box, Paper, Grid } from '@mui/material';
import { styled } from '@mui/material/styles';
import HdIcon from '@mui/icons-material/Hd';
import AudiotrackIcon from '@mui/icons-material/Audiotrack';
import SpeedIcon from '@mui/icons-material/Speed';
import SecurityIcon from '@mui/icons-material/Security';
import DevicesIcon from '@mui/icons-material/Devices';
import TranslateIcon from '@mui/icons-material/Translate';

const GlassContainer = styled(Paper)({
  background: 'linear-gradient(135deg, rgba(26, 26, 46, 0.8) 0%, rgba(22, 33, 62, 0.8) 100%)',
  backdropFilter: 'blur(16px)',
  borderRadius: '20px',
  border: '1px solid rgba(255, 255, 255, 0.1)',
  padding: '2rem',
  marginTop: '2rem',
  color: 'white',
  boxShadow: '0 8px 32px 0 rgba(103, 58, 183, 0.2)',
});

const Title = styled(Typography)({
  marginBottom: '3rem',
  position: 'relative',
  textAlign: 'center',
  '&::after': {
    content: '""',
    position: 'absolute',
    bottom: '-10px',
    left: '50%',
    transform: 'translateX(-50%)',
    width: '100px',
    height: '3px',
    background: 'linear-gradient(90deg, transparent, #673ab7, transparent)',
  },
});

const FeatureCard = styled(Paper)({
  background: 'linear-gradient(135deg, rgba(103, 58, 183, 0.1) 0%, rgba(63, 81, 181, 0.1) 100%)',
  backdropFilter: 'blur(10px)',
  borderRadius: '15px',
  border: '1px solid rgba(255, 255, 255, 0.1)',
  padding: '2rem',
  height: '100%',
  transition: 'all 0.3s ease',
  '&:hover': {
    transform: 'translateY(-5px)',
    boxShadow: '0 8px 32px 0 rgba(103, 58, 183, 0.3)',
    border: '1px solid rgba(103, 58, 183, 0.2)',
    '& .feature-icon': {
      transform: 'scale(1.2) rotate(5deg)',
      color: '#673ab7',
    },
  },
});

const IconWrapper = styled(Box)({
  display: 'flex',
  justifyContent: 'center',
  marginBottom: '1.5rem',
  '& .feature-icon': {
    fontSize: '3rem',
    color: 'rgba(255, 255, 255, 0.9)',
    transition: 'all 0.3s ease',
    filter: 'drop-shadow(0 0 10px rgba(103, 58, 183, 0.3))',
  },
});

const FeatureTitle = styled(Typography)({
  marginBottom: '1rem',
  textAlign: 'center',
  fontWeight: 'bold',
  color: '#fff',
});

const FeatureDescription = styled(Typography)({
  color: 'rgba(255, 255, 255, 0.8)',
  textAlign: 'center',
  lineHeight: 1.6,
});

const features = [
  {
    icon: <HdIcon className="feature-icon" />,
    title: 'جودة عالية',
    description: 'تحميل الفيديوهات بجودة تصل إلى 4K مع الحفاظ على جودة الصوت والصورة',
  },
  {
    icon: <AudiotrackIcon className="feature-icon" />,
    title: 'تحميل الصوت',
    description: 'إمكانية تحميل المقطع الصوتي فقط بصيغة MP3 عالية الجودة',
  },
  {
    icon: <SpeedIcon className="feature-icon" />,
    title: 'سرعة في التحميل',
    description: 'خوارزميات متطورة تضمن سرعة عالية في التحميل مع استقرار الاتصال',
  },
  {
    icon: <SecurityIcon className="feature-icon" />,
    title: 'آمن وموثوق',
    description: 'تحميل آمن بدون إعلانات مزعجة أو برامج ضارة',
  },
  {
    icon: <DevicesIcon className="feature-icon" />,
    title: 'متوافق مع جميع الأجهزة',
    description: 'يعمل على جميع الأجهزة والمتصفحات بدون الحاجة لتثبيت برامج',
  },
  {
    icon: <TranslateIcon className="feature-icon" />,
    title: 'دعم اللغة العربية',
    description: 'واجهة مستخدم كاملة باللغة العربية لتجربة استخدام سلسة',
  },
];

const Features = () => {
  return (
    <Container maxWidth="lg">
      <GlassContainer elevation={3}>
        <Title variant="h4" component="h1">
          مميزات التطبيق
        </Title>
        <Grid container spacing={4}>
          {features.map((feature, index) => (
            <Grid item xs={12} sm={6} md={4} key={index}>
              <FeatureCard elevation={0}>
                <IconWrapper>
                  {feature.icon}
                </IconWrapper>
                <FeatureTitle variant="h6">
                  {feature.title}
                </FeatureTitle>
                <FeatureDescription variant="body1">
                  {feature.description}
                </FeatureDescription>
              </FeatureCard>
            </Grid>
          ))}
        </Grid>
      </GlassContainer>
    </Container>
  );
};

export default Features;
